import React from 'react'
import {Link} from 'react-router-dom'
const LinkRoute = ({LinkRoute,Text}) => {
    return (
        <div>
            <Link
                className="nav-link"
                activeClass="active"
                to={LinkRoute}
                style={{color:"#A6D230"}}
              >
                {Text}
              </Link>
        </div>
    )
}
export default LinkRoute
